import Top from './component/Top';
import Category from './component/Category';
import Footer from './component/Footer';

class App extends Component {
  render(){
  return (
    <React.Fragment>
      <Top/>
      <Category/>
      <Category/>
      <Category/>
      <Footer/>
    </React.Fragment>
  );
}
}

export default App;
